mode.code:
if (Var.AccuDoorPos = 0) {

	DO.6120AccuDoorOpen = Off;
	DO.6130AccuDoorOpen = Off;
	DO.6122AccuDoorClose = On;
	DO.6132AccuDoorClose = On;

	if (DI.6126AccuDoorClose = On and DI.6136AccuDoorClose = On) {
		System.AccuDoor.Mode = Closed;
	}

} else {

	DO.6120AccuDoorOpen = On;
	DO.6130AccuDoorOpen = On;
	DO.6122AccuDoorClose = Off;
	DO.6132AccuDoorClose = Off;	

	if (DI.6124AccuDoorOpen = On and DI.6134AccuDoorOpen = On) {
		System.AccuDoor.Mode = Open;
	}

}

DO.6122AccuDoorClose = Off;
DO.6132AccuDoorClose = Off;

if (DI.6126AccuDoorClose = Off or DI.6136AccuDoorClose = Off) {
	System.AccuDoor.Mode = Moving;
}

DO.6120AccuDoorOpen = Off;
DO.6130AccuDoorOpen = Off;

if (DI.6124AccuDoorOpen = Off or DI.6134AccuDoorOpen = Off) {
	System.AccuDoor.Mode = Moving;
}

if (System.AccuDoor.Mode = Closed) {

	if (Orders(Accumulator).Exists = True) {

		Var.AccuReadyToFill = 1;
		if (Orders(Accumulator).IngSrc.2013Feeder.Exists = True and System.2013Feeder.Mode <> ReadyForDischarge) {
			Var.AccuReadyToFill = 0;
		}

		if (Orders(Accumulator).IngSrc.2033Feeder.Exists = True and System.2033Feeder.Mode <> ReadyForDischarge) {
			Var.AccuReadyToFill = 0;
		}

		if (Orders(Accumulator).IngSrc.3013Feeder.Exists = True and System.3013Feeder.Mode <> ReadyForDischarge) {
			Var.AccuReadyToFill = 0;
		}

		if (Orders(Accumulator).IngSrc.3033Feeder.Exists = True and System.3033Feeder.Mode <> ReadyForDischarge) {
			Var.AccuReadyToFill = 0;
		}

		if (Var.AccuReadyToFill = 1){
			System.Accumulator.Mode = Filling;
		}
	}

} else {
	Var.AccuDoorPos = 0;
	System.AccuDoor.Mode = Moving;
}

if (Orders(Accumulator).Exists = True) {
	Var.SequenceDone = 1;

	if (Orders(Accumulator).IngSrc.2013Feeder.Exists = True and Orders(Accumulator).IngSrc.2013Feeder.Done = False and Var.AccuSequenceNum = Var.2013SequenceNum) {
		Var.SequenceDone = 0;
	}

	if (Orders(Accumulator).IngSrc.2033Feeder.Exists = True and Orders(Accumulator).IngSrc.2033Feeder.Done = False and Var.AccuSequenceNum = Var.2033SequenceNum) {
		Var.SequenceDone = 0;
	}

	if (Orders(Accumulator).IngSrc.3013Feeder.Exists = True and Orders(Accumulator).IngSrc.3013Feeder.Done = False and Var.AccuSequenceNum = Var.3013SequenceNum) {
		Var.SequenceDone = 0;
	}

	if (Orders(Accumulator).IngSrc.3033Feeder.Exists = True and Orders(Accumulator).IngSrc.3033Feeder.Done = False and Var.AccuSequenceNum = Var.3033SequenceNum) {
		Var.SequenceDone = 0;
	}

	if (Var.SequenceDone = 1) {
		Var.AccuSequenceNum = Var.AccuSequenceNum + 1;
	}

	if (Var.AccuSequenceNum > 10) {
		System.Accumulator.Mode = BeltCleanout;
	}

}

if (Var.2013Clean = 0 or Var.2033Clean = 0 or Var.3013Clean = 0 or Var.3033Clean = 0){
	System.BeltCleanout.Mode = Dirty;
}

if (Var.2013Clean = 1 and Var.2033Clean = 1 and Var.3013Clean = 1 and Var.3033Clean = 1){
	System.BeltCleanout.Mode = Clean;
}

if (System.Accumulator.Mode = ReadyForDischarge) {
	System.Mixer.OrderNum = System.Accumulator.OrderNum;
	System.Mixer.Mode = WaitForLiquids;
}

Var.LiquidsReady = 1;

if (Orders(Mixer).IngSrc.7011Liquid.Exists = True and System.7011Liquid.Mode <> ReadyForDischarge) {
	Var.LiquidsReady = 0;
}

if (Orders(Mixer).IngSrc.7021Liquid.Exists = True and System.7021Liquid.Mode <> ReadyForDischarge) {
	Var.LiquidsReady = 0;
}

if (Orders(Mixer).IngSrc.7031Liquid.Exists = True and System.7031Liquid.Mode <> ReadyForDischarge) {
	Var.LiquidsReady = 0;
}

if (Var.LiquidsReady = 1) {
	System.Mixer.Mode = Filling;
}

if (Orders(7011Liquid).Exists = True) {
	if (Orders(7011Liquid).IngSrc.7011Liquid.Done = False) {
		if (Orders(7011Liquid).IngSrc.7011Liquid.Exists = True) {
			Var.7011TargetWeight = Orders(7011Liquid).IngSrc.7011Liquid.TargetWeight - Orders(7011Liquid).IngSrc.7011Liquid.Preact;
			Setpoint.7011Full.Set(Var.7011TargetWeight);
			System.7011Liquid.Mode = Filling;
		} else {
			Orders(7011Liquid).IngSrc.7011Liquid.Done = True;
			System.7011Liquid.NextOrder();
		}
	}
}

if (DI.7114OutletVClosed = On) {

	DO.7150InletVOpen = On;

	if (DI.7152InletVOpen = On) {
		DO.7011InletPump = On;
	} else {
		DO.7011InletPump = Off;
	}

} else {

	DO.7011InletPump = Off;
	DO.7150InletVOpen = Off;

	DO.7110OutletVOpen = Off;

}

DO.7011InletPump = Off;

if (DI.7011InletPump = Off) {
	DO.7150InletVOpen = Off;
	System.7011Liquid.Mode = ReadyForDischarge;
}

function.code:
if (l.do = On and l.di = On) {
	Form.form1.Button.l.btn.BackColor = 255, 0, 255, 0;
} elseif (l.do = On and l.di = Off) {
	Form.form1.Button.l.btn.BackColor = 255, 255, 255, 0;
} elseif (l.do = Off and l.di = On) {
	Form.form1.Button.l.btn.BackColor = 255, 255, 175, 0;
} else  {
	Form.form1.Button.l.btn.BackColor = 255, 255, 0, 0;
}

if (l.do = On) {
	l.do = Off;
} else {
	l.do = On;
}

if (lvar.FeederPaused = 1) {
	lsys.Feeder.Mode = Paused;
} else {

	if (Orders(lo.FeederName).Exists = True) {
		if (Orders(lo.FeederName).IngSrc.lo.FeederName.Done = False) {
			if (Orders(lo.FeederName).IngSrc.lo.FeederName.Exists = True) {
				lvar.SequenceNum = Orders(lo.FeederName).IngSrc.lo.FeederName.Sequence;
				lvar.StartWeight = PLCScale.lo.FeederName - lvar.OverfillAmt;

				if (lvar.StartWeight > Orders(lo.FeederName).IngSrc.lo.FeederName.TargetWeight) {
					lsys.Feeder.Mode = ReadyForDischarge;
				} else {
					lvar.FeederPaused = 1;
				}	

			} else {
				Orders(lo.FeederName).IngSrc.lo.FeederName.Done = True;
				lsys.Feeder.NextOrder();
			}
		}
	}
}

if (lvar.FeederPaused = 1) {
	lsys.Feeder.Mode = Paused;
} else {

	if (System.Accumulator.Mode = Filling and lsys.Feeder.OrderNum = System.Accumulator.OrderNum and lvar.SequenceNum = Var.AccuSequenceNum) {
		lvar.StartWeight = PLCScale.lo.FeederName;
		lvar.TargetWeight = PLCScale.lo.FeederName - Orders(lo.FeederName).IngSrc.lo.FeederName.TargetWeight + Orders(lo.FeederName).IngSrc.lo.FeederName.Preact;
		lsp.Target.Set(lvar.TargetWeight);
		lsp.ToSlow.Set(lvar.TargetWeight + Orders(lo.FeederName).IngSrc.lo.FeederName.ToSlowWeight);
		lsys.Feeder.Mode = MeteringAugers;
	}

}

lvar.Clean = 0;

if (System.4011Conveyor.Mode = Running) {
	ldo.Auger1 = On;
	ldo.Auger2 = On;
	ldo.Auger3 = On;
} else {
	ldo.Auger1 = Off;
	ldo.Auger2 = Off;
	ldo.Auger3 = Off;
}

if (ldi.Auger1 = On and ldi.Auger2 = On and ldi.Auger3 = On) {
	ltmr.MeterTimer.Start(Var.MeterAugerDelay);
} else {
	ltmr.MeterTimer.Stop();
}

if (System.4011Conveyor.Mode = Running) {

	if (ldi.Auger1 = On and ldi.Auger2 = On and ldi.Auger3 = On) {
		ldo.Auger4 = On;
	} else {
		ldo.Auger4 = Off;
		lsys.Feeder.Mode = MeteringAugers;
	}

} else {
	ldo.Auger1 = Off;
	ldo.Auger2 = Off;
	ldo.Auger3 = Off;
	ldo.Auger4 = Off;
	lsys.Feeder.Mode = MeteringAugers;
}

if (System.4011Conveyor.Mode = Running) {
	ldo.Auger4 = On;
	ldo.Auger1 = Off;
	ldo.Auger2 = On;
	ldo.Auger3 = Off;
} else {
	ldo.Auger4 = Off;
	ldo.Auger1 = Off;
	ldo.Auger2 = Off;
	ldo.Auger3 = Off;
}

ldo.Auger4 = Off;
ldo.Auger1 = Off;
ldo.Auger2 = Off;
ldo.Auger3 = Off;

if (PLCScale.lo.FeederName.Stable = True) {
	lsys.Feeder.Mode = Finished;
}

Orders(lo.FeederName).IngSrc.lo.FeederName.ActualWeight = lvar.StartWeight - PLCScale.lo.FeederName;
Orders(lo.FeederName).IngSrc.lo.FeederName.Done = True;
lsys.Feeder.NextOrder();
ltmr.Cleanout.Start(lvar.CleanoutTime);
lsys.Feeder.Mode = WaitingForOrder;

